import React from 'react';

type LineChartProps = {
  data: {
    labels: string[];
    datasets: {
      label: string;
      data: number[];
      borderColor: string;
      backgroundColor: string;
      borderWidth: number;
      tension: number;
    }[];
  };
  options?: any;
};

const LineChart: React.FC<LineChartProps> = ({ data, options }) => {
  const defaultOptions = {
    responsive: true,
    maintainAspectRatio: false,
    plugins: {
      legend: {
        position: 'top' as const,
      },
      title: {
        display: false,
        text: 'Chart.js Line Chart',
      },
      tooltip: {
        backgroundColor: 'rgba(0, 0, 0, 0.8)',
        titleColor: '#fff',
        bodyColor: '#fff',
        borderColor: 'rgba(0, 0, 0, 0.1)',
        borderWidth: 1,
        padding: 10,
        usePointStyle: true,
      },
    },
    scales: {
      y: {
        beginAtZero: true,
        grid: {
          color: 'rgba(0, 0, 0, 0.05)',
        },
      },
      x: {
        grid: {
          display: false,
        },
      },
    },
    animation: {
      duration: 1000,
      easing: 'easeOutQuart' as const,
    },
  };

  const chartOptions = options || defaultOptions;

  if (!data || !data.labels || !data.datasets || data.labels.length === 0) {
    return (
      <div className="flex items-center justify-center h-full bg-gray-50 rounded-lg">
        <div className="text-center p-6">
          <svg
            className="mx-auto h-12 w-12 text-gray-400"
            fill="none"
            viewBox="0 0 24 24"
            stroke="currentColor"
            aria-hidden="true"
          >
            <path
              strokeLinecap="round"
              strokeLinejoin="round"
              strokeWidth={2}
              d="M9 19v-6a2 2 0 00-2-2H5a2 2 0 00-2 2v6a2 2 0 002 2h2a2 2 0 002-2zm0 0V9a2 2 0 012-2h2a2 2 0 012 2v10m-6 0a2 2 0 002 2h2a2 2 0 002-2m0 0V5a2 2 0 012-2h2a2 2 0 012 2v14a2 2 0 01-2 2h-2a2 2 0 01-2-2z"
            />
          </svg>
          <h3 className="mt-2 text-sm font-medium text-gray-900">No data available</h3>
          <p className="mt-1 text-sm text-gray-500">Data will appear here once generated.</p>
        </div>
      </div>
    );
  }

  return (
    <div className="h-full relative overflow-hidden">
      <div className="absolute inset-0 bg-gradient-to-r from-blue-50 to-indigo-50 opacity-50 rounded-lg"></div>
      <div className="relative h-full flex flex-col">
        <div className="flex justify-between items-center px-4 py-2">
          <div className="flex flex-wrap gap-2">
            {data.datasets.map((dataset, index) => (
              <div key={index} className="flex items-center">
                <div
                  className="w-3 h-3 rounded-full mr-1"
                  style={{ backgroundColor: dataset.borderColor }}
                ></div>
                <span className="text-xs font-medium">{dataset.label}</span>
              </div>
            ))}
          </div>
        </div>
        <div className="flex-1 p-4">
          <div className="h-full flex items-end">
            {data.labels.map((label, labelIndex) => {
              const values = data.datasets.map(dataset => dataset.data[labelIndex] || 0);
              const maxValue = Math.max(...values);
              const totalValues = values.length;

              return (
                <div key={labelIndex} className="flex-1 flex flex-col items-center">
                  <div className="w-full flex justify-center items-end h-[85%]">
                    {data.datasets.map((dataset, datasetIndex) => {
                      const value = dataset.data[labelIndex] || 0;
                      const height = maxValue > 0 ? (value / maxValue) * 100 : 0;
                      const width = 100 / data.labels.length / totalValues * 0.8;

                      return (
                        <div
                          key={datasetIndex}
                          className="mx-px rounded-t-sm transition-all duration-500 ease-out"
                          style={{
                            height: `${height}%`,
                            width: `${width}%`,
                            backgroundColor: dataset.backgroundColor,
                            transform: 'scaleY(1)',
                            transformOrigin: 'bottom',
                            animation: 'growUp 1s ease-out'
                          }}
                        ></div>
                      );
                    })}
                  </div>
                  <div className="text-xs text-gray-500 mt-1 truncate w-full text-center">
                    {label}
                  </div>
                </div>
              );
            })}
          </div>
        </div>
      </div>

      {/* React-compatible animation style */}
      <style
        dangerouslySetInnerHTML={{
          __html: `
            @keyframes growUp {
              from { transform: scaleY(0); }
              to { transform: scaleY(1); }
            }
          `
        }}
      />
    </div>
  );
};

export default LineChart;
